{
    "rules": {
      ".read": "auth !== null", // read via geofire
      ".write": "auth !== null",

        "_geofire" :{
          ".read": "auth !== null",
          ".write": "auth !== null",  // all writes via geofire  


          // Index each location's geohash for faster querying
          ".indexOn": ["g"]
        }
    }
